import React, {useEffect, useState} from 'react'
import { FormContent, FormLabel } from './SigninElements'
import {Container,FormWrap, Icon, FormButton,Text,FormH1,Form,FormInput} from './SigninElements';
export const SignIn = () => {

    const [email, setEmail] = useState('');
    const handleEmailChange = (e) => {setEmail(e.target.value)} 


    const [password, setPassword] = useState('');
    const handlePasswordChange = (e) => {setPassword(e.target.value)} 
    

    const handleSubmit = (e) => {console.log(email, password)}
    return (
        <>
            <Container>
                <FormWrap>
                    <Icon to="/">Your Pharmacy</Icon>
                    <FormContent>
                        <Form>
                            <FormH1>Log in to your account.</FormH1>
                            <FormLabel htmlFor='for'>Email</FormLabel>
                            <FormInput 
                                type='email '
                                onChange={handleEmailChange} 
                                value={email} required
                            />

                            <FormLabel htmlFor='for' >Password</FormLabel>
                            <FormInput
                                type='password'
                                onChange={handlePasswordChange}
                                value={password}
                                required
                            />


                            <FormButton type='submit' onClick={handleSubmit}>Login</FormButton>
                            <Text>Forgot password</Text>
                        </Form>
                    </FormContent>
                </FormWrap>
            </Container>
        </>
    )
}
